bool_t
xdr_gfs3_compound_rsp (XDR *xdrs, gfs3_compound_rsp *objp)
{
	register int32_t *buf;

	 if (!xdr_int (xdrs, &objp->op_ret))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->op_errno))
		 return FALSE;
	 if (!xdr_array (xdrs, (char **)&objp->compound_rsp_array.compound_rsp_array_val, (u_int *) &objp->compound_rsp_array.compound_rsp_array_len, ~0,
		sizeof (compound_rsp), (xdrproc_t) xdr_compound_rsp))
		 return FALSE;
	 if (!xdr_bytes (xdrs, (char **)&objp->xdata.xdata_val, (u_int *) &objp->xdata.xdata_len, ~0))
		 return FALSE;
	return TRUE;
}

bool_t
xdr_gfs3_locklist (XDR *xdrs, gfs3_locklist *objp)
{
	register int32_t *buf;

	 if (!xdr_gf_proto_flock (xdrs, &objp->flock))
		 return FALSE;
	 if (!xdr_string (xdrs, &objp->client_uid, ~0))
		 return FALSE;
	 if (!xdr_u_int (xdrs, &objp->lk_flags))
		 return FALSE;
	 if (!xdr_pointer (xdrs, (char **)&objp->nextentry, sizeof (gfs3_locklist), (xdrproc_t) xdr_gfs3_locklist))
		 return FALSE;
	return TRUE;
}

